import { useState } from 'react';
import Layout from '../components/Layout';

const initialState = {
  name: '',
  email: '',
  password: '',
  error: '',
  success: '',
  buttonText: 'Register',
  hidden: true,
};

const Register = () => {
  const [state, setState] = useState(initialState);

  const { name, email, password, error, success, buttonText, hidden } = state;

  const registerForm = () => (
    <form>
      <div className='form-group'>
        <input type='text' className='form-control' placeholder='Name' />
      </div>
      <div className='form-group'>
        <input type='email' className='form-control' placeholder='Email' />
      </div>
      <div className='form-group'>
        <div className='input-group'>
          <input
            type={hidden ? 'password' : 'text'}
            className='form-control'
            placeholder='Password'
          />
          <div className='input-group-append'>
            <div
              className='input-group-text'
              onClick={() => setState({ ...initialState, hidden: !hidden })}
            >
              <i className={hidden ? 'fas fa-eye' : 'fas fa-eye-slash'} />
            </div>
          </div>
        </div>
      </div>
      <div className='form-group'>
        <button className='btn btn-outline-success bold-btn'>Register</button>
      </div>
    </form>
  );

  return (
    <Layout>
      <div className='col-md-6 offset-md-3'>
        <h1>Register</h1>
        <br />

        {registerForm()}
      </div>
    </Layout>
  );
};

export default Register;
